import React, { Component } from "react";
import logo from "./logo.svg";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import MenuItem from "@material-ui/core/MenuItem";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import FormGroup from "@material-ui/core/FormGroup";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Checkbox from "@material-ui/core/Checkbox";
import Container from "@material-ui/core/Container";
import Typography from "@material-ui/core/Typography";
import Divider from "@material-ui/core/Divider";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { show: true };

    this.toggleDiv = this.toggleDiv.bind(this);
  }

  toggleDiv = () => {
    const { show } = this.state;
    this.setState({ show: !show });
  };

  render() {
    return (
      <div className="App-intro">
        <br />
        <button onClick={this.toggleDiv}>Toggle div</button>
        <br />
        <br />
        {this.state.show && <Box />}
      </div>
    );
  }
}

class Box extends Component {
  render() {
    const { classes } = this.props;
    return (
      <Container maxWidth="lg">
        <Paper className={classes.root} elevation={1}>
          <Typography className={classes.title} align="center" variant="h6">
            Client Information
          </Typography>
          <Grid container row justify="flex-end" />
          <Grid container justify="center" alignItems="center">
            <TextField
              required
              id="standard-firstName"
              label="First Name"
              variant="outlined"
              className={classes.textField}
              value={this.state.clientFirstName}
              onChange={this.handleChange("clientFirstName")}
              margin="normal"
            />
            <TextField
              required
              id="standard-lastNamename"
              label="Last Name"
              variant="outlined"
              className={classes.textField}
              value={this.state.clientLastName}
              onChange={this.handleChange("clientLastName")}
              margin="normal"
            />
            <TextField
              required
              id="standard-email"
              variant="outlined"
              label="Email"
              className={classes.textField}
              value={this.state.clientEmail}
              onChange={this.handleChange("clientEmail")}
              margin="normal"
            />
            <TextField
              required
              id="standard-password-input"
              variant="outlined"
              label="Password"
              className={classes.textField}
              type="password"
              value={this.state.clientCurrentPassword}
              onChange={this.handleChange("clientCurrentPassword")}
              //autoComplete="current-password"
              margin="normal"
            />
            <TextField
              required
              id="standard-confirmPassword-input"
              variant="outlined"
              label="Confirm Password"
              className={classes.textField}
              type="password"
              value={this.state.confirmPassword}
              onChange={this.handleChange("confirmPassword")}
              //autoComplete="current-password"
              margin="normal"
            />

            <TextField
              id="standard-cost"
              label="Session Cost (dollars)"
              variant="outlined"
              className={classes.textField}
              value={this.state.sessionCost}
              onChange={this.handleChange("sessionCost")}
              margin="normal"
            />
            <TextField
              id="standard-length"
              label="Session Length (minutes)"
              variant="outlined"
              className={classes.textField}
              value={this.state.sessionLength}
              onChange={this.handleChange("sessionLength")}
              margin="normal"
            />

            <TextField
              id="standard-address"
              variant="outlined"
              label="Address"
              className={classes.textField}
              value={this.state.clientAddress}
              onChange={this.handleChange("clientAddress")}
              margin="normal"
            />
            <TextField
              id="standard-city-"
              variant="outlined"
              label="City"
              className={classes.textField}
              value={this.state.clientCity}
              onChange={this.handleChange("clientCity")}
              margin="normal"
            />
            <TextField
              id="standard-state"
              variant="outlined"
              label="State"
              className={classes.textField}
              value={this.state.clientState}
              onChange={this.handleChange("clientState")}
              margin="normal"
            />
            <TextField
              id="standard-zipCode"
              variant="outlined"
              label="Zip Code"
              className={classes.textField}
              value={this.state.clientZipCode}
              onChange={this.handleChange("clientZipCode")}
              margin="normal"
            />
            <TextField
              id="standard-phone"
              variant="outlined"
              label="Phone Number"
              className={classes.textField}
              value={this.state.clientPhone}
              onChange={this.handleChange("clientPhone")}
              margin="normal"
            />
            <TextField
              id="standard-bday"
              variant="outlined"
              label="Birthday"
              className={classes.textField}
              value={this.state.clientBday}
              onChange={this.handleChange("clientBday")}
              margin="normal"
            />

            <Grid container justify="center" alignItems="center">
              <TextField
                id="standard-full-width"
                label="Additional Notes"
                style={{ margin: 8 }}
                className={classes.textField2}
                value={this.state.clientNotes}
                onChange={this.handleChange("clientNotes")}
                placeholder="Add any additional notes here"
                fullWidth
                multiline
                margin="normal"
                InputLabelProps={{
                  shrink: true
                }}
              />
            </Grid>

            <Container>
              <Typography className={classes.title} align="center" variant="h6">
                Contact Information
              </Typography>
            </Container>
            <div>
              <Divider />
            </div>
            {/* Contact Info*/}

            <TextField
              required
              id="standard-contactFirstName"
              label="First Name"
              variant="outlined"
              className={classes.textField}
              value={this.state.contactFirstName}
              onChange={this.handleChange("contactFirstName")}
              margin="normal"
            />
            <TextField
              required
              id="standard-lastNamename"
              label="Last Name"
              variant="outlined"
              className={classes.textField}
              value={this.state.contactLastName}
              onChange={this.handleChange("contactLastName")}
              margin="normal"
            />
            <TextField
              id="standard-contactAddress"
              variant="outlined"
              label="Street Address"
              className={classes.textField}
              value={this.state.contactAddress}
              onChange={this.handleChange("contactAddress")}
              margin="normal"
            />
            <TextField
              id="standard-contactCity-"
              variant="outlined"
              label="City"
